#!/usr/bin/env python3

TIMEOUT=10

import time
import sys
import subprocess
import queue
import threading
import os
import os.path
import tempfile
import gzip
import io
import hashlib

Q = queue.Queue()


keeplooping=True
def threadFunc(so):
    while keeplooping:
        ln = ""
        while True:
            b = so.read(1)
            if len(b) == 0:
                return
            elif b == b"\n":
                break
            else:
                ln += b.decode(errors="replace")
        print(ln)
        Q.put(ln)
   
def read(fp,delim=None):
    s=b""
    while True:
        c = fp.read(1)
        if c == None:
            return s
        if (delim == None and c.isspace()) or c == delim:
            return s
        s += c
        if len(s) > 100:
            print("Line too long")
            assert 0
        
def readppm(fp):
    if type(fp) == bytes:
        fp = io.BytesIO(fp)
        
    assert b"P6" == read(fp)
    w = int(read(fp))
    h = int(read(fp))
    read(fp,b"\n")
    data = fp.read()
    return w,h,data
    
def findTestsuite():
    testsuites=[]
    for dirpath,dirs,files in os.walk(sys.path[0]):
        for fn in files:
            if fn.endswith(".c") or fn.endswith(".C"):
                with open(fn,"r") as fp:
                    data = fp.read()
                    data = data.replace("\r","")
                    H = hashlib.sha1()
                    H.update(data.encode())
                    s1 = H.hexdigest()
                    if s1 == "43c7a2abe74775870c39d4d0974100143bbb04a0":
                        testsuite = os.path.join(dirpath,fn)
                        testsuites.append(testsuite)
    return testsuites
                        
def main():
    testsuites=findTestsuite()
    if len(testsuites) == 0:
        print("Cannot find *unmodified* copy of the test suite.")
        return
        
    
    if not runTest(0):
        print("Wrong output from first test suite")
        return
      
    print("First test suite OK")
    
    for t in testsuites:
        if tryAgain(t):
            print("Second test suite OK")
            print("All OK")
            return
            
    print("Wrong output from second test suite")
    
def tryAgain(testsuite):
    with open(testsuite,"rb") as fp:
        odata = fp.read()
    try:
        with open(testsuite,"wb") as fp:
            fp.write(gzip.decompress(testsuite2))
        if runTest(1):
            return True
    finally:
        with open(testsuite,"wb") as fp:
            fp.write(odata)

def runTest(which):
    
    now = int(time.time())
    
    scons = os.getenv("SCONS",os.path.abspath("scons.bat"))
    scons = "..\\scons\\scons.bat"
    
    P = subprocess.Popen( [scons],
        stdin=subprocess.PIPE,
        stdout=subprocess.PIPE,
        stderr=subprocess.STDOUT)
        
    si = P.stdin
    thr = threading.Thread(target=threadFunc, args=(P.stdout,))
    thr.start()

    start = time.time()
    
    while True:
        try:
            line = Q.get(block=True,timeout=TIMEOUT).strip()
        except queue.Empty:
            print("Timeout reached waiting for output!",file=sys.stderr)
            P.terminate()
            return
    
        now = time.time()
        if now - start > TIMEOUT:
            print("Timeout reached!",file=sys.stderr)
            return
            
        if "DONE" in line:
            tf = tempfile.NamedTemporaryFile(delete=False)
            try:
                tf.close()
                print("Using temporary file",tf.name)
                si.write(b"~c\n")
                si.write("screendump {}\n".format( tf.name ).encode() )
                si.write(b"quit\n")
                si.flush()
                P.wait(timeout=TIMEOUT)
                with open(tf.name,"rb") as fp:
                    aw,ah,actual = readppm(fp)
            finally:
                os.unlink(tf.name)
 

            if which == 0:
                ew,eh,expected = readppm( gzip.decompress(expected1) )
            else:
                ew,eh,expected = readppm( gzip.decompress(expected2) )
                
            
            if ew != aw:
                print("Width mismatch; expected {}; got '{}'".format(ew,aw))
                return
            if eh != ah:
                print("Height mismatch; expected {}; got '{}'".format(eh,ah))
                return
            
            idx=0
            for y in range(ah):
                for x in range(aw):
                    for i in range(3):
                        a = actual[idx+i] & 0xf8
                        e = expected[idx+i] & 0xf8
                        if a != e:
                            pfp = "TESTSUITE{}.txt".format(which)
                            with open(pfp,"w") as ppp:
                                ppp.write(gzip.decompress(testsuite2).decode())
                            print("Wrote",pfp)
                            pfp = "PROBLEM{}.ppm".format(which)
                            pfp = os.path.abspath(pfp)
                            with open(pfp,"wb") as ppp:
                                ppp.write("P6 {} {} 255\n".format(aw,ah).encode())
                                ppp.write(actual)
                            print("Wrote",pfp)
                            pfp = "EXPECTED{}.ppm".format(which)
                            pfp = os.path.abspath(pfp)
                            with open(pfp,"wb") as ppp:
                                ppp.write("P6 {} {} 255\n".format(ew,eh).encode())
                                ppp.write(expected)
                            print("Wrote",pfp)
                            print("Mismatch at pixel x={} y={}".format(x,y))
                            print("Expected:",
                                "r=",expected[idx],
                                "g=",expected[idx+1],
                                "b=",expected[idx+2])
                            print("Actual:",
                                "r=",actual[idx],
                                "g=",actual[idx+1],
                                "b=",actual[idx+2])
                            return
                    idx+=3
              
            return True
    #endwhile
    

